column8:
スタイルアップ効果抜群のオールインワン・パンツドレス
ワイドパンツがクールなスタイルで大人カッコイイ
エレガントかつクールなデザインなので、幅広い年代の方に着用していただけます。
ゆったりとしたトップスとタイトなウエストでくびれ効果抜群！
Vラインで抜け感のある首元
バックスリットで背中も肌見せでセクシー
くびれを作り出すウエストデザイン
足長効果抜群の10分丈ワイド
結婚式や二次会、入学、卒業パーティなど、幅広いフォーマルシーンなどにお使いいただけます。<!--買い物かご項目選択カスタム-->
